  summary: "\nMakes a call to retrieve the <xref href=\"System.Web.SessionState.HttpSessionState.SessionID\" data-throw-if-not-resolved=\"false\"></xref>. This is done so the session is generated at the beginning of the request.\nIf this isn&apos;t called the session (when using WCF) is generated late in the pipeline, which can cause issues when trying to work with WCF.\nGets executed after <xref href=\"Cqrs.Hosts.CqrsHttpApplication.Application_AuthenticateRequest(System.Object%2cSystem.EventArgs)\" data-throw-if-not-resolved=\"false\"></xref> when a new session for a &quot;user&quot; starts such as a first request or after a session has expired.\nThis event doesn&apos;t get triggered if you are not using sessions which can be disabled in the web.config.\n"
